import styled from "styled-components";

export const Wrapper = styled.div`
    position: relative;
    width: 100%;
    height: 20vh;
`;

export const Content = styled.div`
    position: absolute;
    top: 0;
    left: 0
li {
   list-style: none;
}
`;
